import './SwiperExample.css';

import { Navigation, Pagination, Scrollbar, A11y } from 'swiper/modules';

import { Swiper, SwiperSlide } from 'swiper/react';

import Image1 from '../Swiper/Image/image1.webp';
import Image2 from '../Swiper/Image/image2.webp';
import Image3 from '../Swiper/Image/image3.webp';

import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';

import { Col, Container, Row } from 'react-bootstrap';

function SwiperExample(){
    return(
        <Container fluid>
            <Row>
            <Col xl = "9" md = "9" sm = "12">
                <Swiper
            modules={[Navigation, Pagination, Scrollbar, A11y]}
            spaceBetween={10}
            slidesPerView={3}
            navigation>
                
                <SwiperSlide>
                    <div className = "swiper-wrapper">
                        <img src = {Image1} className = "w-100 h-100"/>

                        <div className = "swiper-content">
                            <h1>Title of Swiper</h1>
                        </div>
                    </div>
                </SwiperSlide>

                <SwiperSlide>
                    <img src = {Image2} className = "w-100 h-100"/>
                </SwiperSlide>

                <SwiperSlide>
                    <img src = {Image3} className = "w-100 h-100"/>
                </SwiperSlide>

                <SwiperSlide>
                    <img src = {Image1} className = "w-100 h-100"/>
                </SwiperSlide>

                <SwiperSlide>
                    <img src = {Image2} className = "w-100 h-100"/>
                </SwiperSlide>

                <SwiperSlide>
                    <img src = {Image3} className = "w-100 h-100"/>
                </SwiperSlide>
            </Swiper>
            </Col>

            <Col xl = "3" md = "3" sm = "12">
                <img src = {Image1} className = "w-100 h-100"/>
            </Col>
            </Row>
        </Container>
    )
}

export default SwiperExample
